var $bm_rt;
var colorInput, light, dark, standart;
colorInput = thisComp.layer('_light/dark').text.sourceText;
light = [
    1,
    1,
    1,
    1
];
dark = [
    0.2118,
    0.2118,
    0.2118,
    1
];
$bm_rt = standart = light;
if (colorInput == 0) {
    $bm_rt = light;
} else if (colorInput == 1) {
    $bm_rt = dark;
} else {
    $bm_rt = standart;
}
