p.x:
var $bm_rt;
var posTextX, posTextY, offsetRight, textHeight, textWidth, x, y;
posTextX = thisComp.layer('_text').transform.position[0];
posTextY = thisComp.layer('_text').transform.position[1];
offsetRight = 100;
textHeight = thisComp.layer('_text').sourceRectAtTime().height;
textWidth = thisComp.layer('_text').sourceRectAtTime().width;
x = $bm_sum($bm_sub(posTextX, $bm_div(textWidth, 2)), $bm_div(offsetRight, 2));
y = posTextY;
$bm_rt = [
    x,
    y
];

